import React from 'react'

export default function About() {
    return (
        <div style={{ fontSize: '2rem', fontFamily: 'cursive'}}>
            skribbl.io is a free multiplayer drawing and guessing game.<br></br>
            One game consists of a few rounds in which every round <br></br>
            someone has to draw their chosen word and others have to <br></br>guess it to gain points! The person with the most points at the end of game will then be crowned as the winner!
        </div>
    )
}
